import React from 'react';
import './css/App.css';
import photo1 from "../photo/IMG_2002.jpg";
import Library from './Library';

function App2() {
  return (
    <>
      <div className="App">
          <h1 className="focus-in-expand text-6xl">Kijima Riku</h1>
          <img src={photo1} alt="photo1" className="back-image"/>
      </div>
      <Library />
    </>
  );
}

export default App2;
